import axios from "axios"
export function getDetailsByLid(lid){
    return new Promise(
        (resolve,reject)=>{
            axios.get("/details",{
                params:{
                    lid //lid:lid
                }
            }).then(result=>{
                resolve(result.data);
            })
        }
    )
}
